    [],nt"revision_timestamp": "2015-09-26T21:49:14.319164",nt"name": "asos-station-photos",nt"isopen":
    false,nt"url": null,nt"notes": "The images contained in this library are
    of stations in the Automated Surface Observing System (ASOS) network. These images
    were taken between 1998-2001 for the ASOS Tropical Cyclone Wind Exposure Documentation
    Project, led by NOAA's Hurricane Research Division. The Project's purpose was to
    document the siting, equipment, and exposure existing at various sites along the
    Gulf Coast and East Coast of the Unites States, as well as sites in Puerto Rico,
    Hawaii and Guam. During each site visit, eight photos were taken facing the station
    in 45 degree increments. The eight photos and their corresponding thumbnail images
    are available in this library.",nt"license_title": null,nt"extras": [{ntt"key":
